const initialState = {
  user: {
    isLoggedIn: false,
    user: null,
    signUpData: {},
    loginData: {},
  },
}

const login = (data) => {
  return {
    type: 'LOG_IN',
    data,
  }
}

const auth = (state = initialState, action) => {}

export default auth
